@-moz-document domain("nicovideo.jp") {
/*ヘッダーの検索バーを横並びに*/
.HeaderContainer-main{display:flex;width:700px;justify-content:space-between;align-items:center;}
.HeaderContainer-main::before{left:480px}
/*ユーザーへのおすすめのやつ(ニコレポに置きたいけどcssのoverrideじゃ無理っぽ)*/
.PersonalFrame-wrapper{display:none}
/*右側の余白を縮ませる*/
.UserPage-main{padding-right:0;}
.NicorepoPage-content,.UserDetailsHeader-body{flex-grow:2;margin-right:80px;}
.UserDetailsStatus{width:auto;}
.MainMenuContainer-menuList{padding-right:80px}
/*広告を右側へ*/
.RightSideContainer,.RightSideAdContainer{margin-left:640px;}
}

@-moz-document domain("vk.com"), domain("vkforms.ru") {
