}

[dir=ltr] .ts_wrap .input_back_content {
	font-size: 13px;
	color: #8fadc8;
	line-height: 16px;
}

[dir=ltr] .ts_cont_wrap {
	position: absolute;
	top: 39px;
	left: 173px;
	background: #F8F8F8;
	width: 248px;
	z-index: 800;
	border-radius: 4px;
	box-shadow: 0 1px 4px rgba(0,0,0, .2);
	overflow: hidden;
	display: none;
}

[dir=ltr] .im-member-item .im-member-item--photo img {
	width: 46px;
	height: 46px;
